import React from 'react';
import Snippet from './Snippet';

const Example = (props) => {
    return (
        <>
            <h3>{props.heading}</h3>
            <p>{props.desc}</p>
            <Snippet endpoint={props.endpoint} params={props.params}></Snippet>
        </>
    );
}

export default Example;

